import "./ControleDeEstoque.css"

function ControleDeEstoque(){

    return(
        <div className="ControleDeEstoque">
            <h1>Lista de estoque</h1>
            <div className="Estoque">
                <input placeholder="material"/>
            </div>
        </div>
    )

}

export default ControleDeEstoque;
